import styled from 'styled-components'

const Outer = styled.div`

    div.table{
        width: 100%;
        display: table;
    }

    div.table-row{
        width: 80%;
        padding-left: 10%;
        padding-right: 10%;  
        display: table-row;
    }

    #photo{
        width: 25%;
        display: table-cell;
        border: 2px solid red;
    }

    #text{
        width: 40%;
        display: table-cell;
        border: 2px solid red;
    }

    ul{
        text-align: left;
        padding-left: 1%;
        padding-right: 1%;
        list-style-type: square;
        list-style-position: inside;
    }

    div.dateLocation{
        margin-top: 2.5%;
    }
`

export default Outer
